import React from "react";
export default class Cursor extends React.Component {
  render() {
    const mouse = this.props.mouse;
    return (
      <div
        style={{
          position: "absolute",
          left: mouse.x,
          top: mouse.y,
          width: 20,
          height: 20,
          borderRadius: "50%",
          background: "red"
        }}
      >
        {" "}
        {mouse.x} {mouse.y}{" "}
      </div>
    );
  }
}
